import { Button } from '@mantine/core';

export function Register() {
  return (
    <div className={`w-72 h-screen bg-white z-10 shrink md:max-w-lg fixed hidden lg:block`}>
    <Button className="bg-primary-accent hover:bg-secondary-accent">
      Cadastrar
    </Button>
    </div>
  );
}
